import React from "react";
import { Link } from "react-router-dom";
import Logo from "../Images/favicon.svg";
import search from "../Images/search.png";
import close from "../Images/close.png";

function Header() {
  return (
    <div className="header">
      <Link to="#">
        <img src={Logo} width="60" height="32" alt="Flicks home" />
      </Link>
      <div className="search-box" search-box>
        <div className="search-wrapper" search-wrapper>
          <input
            type="text"
            name="search"
            aria-label="search movies"
            className="input-field"
            placeholder="search movies..."
            search-field
          />
          <img
            src={search}
            width="24"
            height="24"
            alt="search"
            className="leading-icon"
          />
        </div>
        <button className="search-btn" search-toggler>
          <img src={close} width="24" height="24" alt="" />
        </button>
      </div>
    </div>
  );
}

export default Header;
